import React, { Component } from 'react';
import { AppContext } from '../provider/StateProvider';
import './dashboard.css';

export default class Dashboard extends Component {
  render() {
    //
    return (
      <div className="card">
        <AppContext.Consumer>
          {context => (
            <div>
              <h1>
                {context.person.name}
                <br />
                {context.person.surname}
              </h1>
              <h2>
                {/* {context.person.transactions} */}
                console.log(context.person.transactions);
              </h2>
            </div>
          )}
        </AppContext.Consumer>
      </div>
    );
  }
}
